import React from "react";

import { Router, Route, RouteHandler } from "react-router";
import { Link } from "react-router-dom";
import logo from "../logo.png";
import "../App.css";
import "../routes/routes.js";
import { render } from "@testing-library/react";
import profile from "../logo2.png";
import Toolbar from "react-minimalist-toolbar";
import { ProgressBar, Button } from "react-bootstrap";
import ServerTable from "react-strap-table";
import { ReactTabulator } from "react-tabulator";
import "react-tabulator/lib/css/bootstrap/tabulator_bootstrap.min.css";

function Exams() {
  const columns = [
    { title: "Name", field: "name", width: 150 },
    { title: "Age", field: "age", align: "left", formatter: "progress" },
    { title: "Favourite Color", field: "col" },
    { title: "Date Of Birth", field: "dob", align: "center" },
    { title: "Rating", field: "rating", align: "center", formatter: "star" },
    { title: "Passed?", field: "passed", align: "center", formatter: "tickCross" }
  ];
  return (
    <div className="App">
      <div className="App-home">
        <Toolbar logo={logo} brand="InfoKC" className="toolbar"></Toolbar>
        <p></p>
        <p></p>
        <p className="App-p">Slobodni termini</p>
        <div bgColor="transparent" className="Div-vertical"></div>
      </div>
    </div>
  );
}
export default Exams;
